import React from 'react';

const BlockInfo = (props) =>{

    const block_data = props.information;

    console.log(props);

    return(
        <div className="container">
            <div className="row">
                <div className="col-sm-7">{block_data.id}</div>
                <div className="col-sm-3">{block_data.timestamp}</div>
                <div className="col-sm-2">{block_data.transactions.length}</div>
            </div>
        </div>
    )
}

export default BlockInfo;
